import React from 'react';
import AnimatedSvgLine from '../animated/animated-svg-line';

const ContinueToCV = () => (
    <AnimatedSvgLine>
        <button>
            CONTINUE
        </button>
    </AnimatedSvgLine>
);

export default ContinueToCV;
